import React from "react"
import airplane from './PaperAirplane.svg';

function Landing(props) {
    return (
        <div id="landing">
            <img id="img-airplane" src={airplane}/>
            <h1><span>Anneliese Wen</span></h1>
        </div>
    )
}

export default Landing;
